import { useState, useEffect, useRef } from 'react';

// Tipos para el producto
interface Product {
  id: string;
  name: string;
  price: number;
  color: string;
  row: number;
  col: number;
}

// Tipos para las transiciones
interface Transition {
  from: string;
  input: string;
  to: string;
  time: number;
}

// Tipos para los sonidos
type SoundFunction = () => void;

const VendingMachine = () => {
  const [state, setState] = useState('Q0'); // Estados del autómata Q0 a Q30
  const [balance, setBalance] = useState(0);
  const [message, setMessage] = useState('Bienvenido! Inserta monedas');
  const [selectedProduct, setSelectedProduct] = useState<Product | null>(null);
  const [dispensing, setDispensing] = useState(false);
  const [transitionLog, setTransitionLog] = useState<Transition[]>([]);
  const [displayTime, setDisplayTime] = useState('');
  const [inputCode, setInputCode] = useState('');

  const coinSoundRef = useRef<SoundFunction | null>(null);
  const dispenseSoundRef = useRef<SoundFunction | null>(null);

  // Productos con nuevos precios
  const products = [
    { id: '11', name: 'Chetos', price: 1500, color: '#FF4444', row: 0, col: 0 },
    { id: '12', name: 'Detodito', price: 2500, color: '#FF8800', row: 0, col: 1 },
    { id: '13', name: 'Cheestres', price: 3000, color: '#8844FF', row: 0, col: 2 }
  ];

  // Máximo de saldo permitido
  const MAX_BALANCE = 3000;

  // Mapeo de estado a saldo (Q0 = $0, Q1 = $100, Q2 = $200, ..., Q30 = $3000)
  // const getBalanceFromState = (state: string): number => {
  //   const stateNum = parseInt(state.substring(1));
  //   return stateNum * 100;
  // };

  const getStateFromBalance = (balance: number): string => {
    return `Q${balance / 100}`;
  };

  // Estados del autómata finito (Q0 a Q30 para representar $0 a $3000)
  const PHASES = {
    IDLE: 'IDLE',
    ACCEPTING_COINS: 'ACCEPTING_COINS',
    PRODUCT_SELECTED: 'PRODUCT_SELECTED',
    DISPENSING: 'DISPENSING'
  };

  const [phase, setPhase] = useState(PHASES.IDLE);

  // Actualizar reloj
  useEffect(() => {
    const interval = setInterval(() => {
      const now = new Date();
      setDisplayTime(now.toLocaleTimeString('es-CO', { hour: '2-digit', minute: '2-digit' }));
    }, 1000);
    return () => clearInterval(interval);
  }, []);

  // Sonidos
  useEffect(() => {
    // Audio de moneda personalizado
    const coinAudio = new Audio('data:audio/mp3;base64,');
    coinSoundRef.current = () => {
      coinAudio.currentTime = 0; // Reinicia el audio
      coinAudio.volume = 0.5; // Volumen (0.0 a 1.0)
      coinAudio.play();
    };

    const dispenseAudio = new Audio('data:audio/mp3;base64,');
  dispenseSoundRef.current = () => {
    dispenseAudio.currentTime = 0;
    dispenseAudio.volume = 0.5;
    dispenseAudio.play();
    };
  }, []);

  const addTransition = (from: string, input: string, to: string) => {
    setTransitionLog(prev => [...prev.slice(-6), { from, input, to, time: Date.now() }]);
  };

  const handleNumberPress = (num: string) => {
    if (dispensing) return;
    
    const newCode = inputCode + num;
    setInputCode(newCode);
    
    // Buscar producto por código
    const product = products.find(p => p.id === newCode);
    
    if (product) {
      setSelectedProduct(product);
      if (phase === PHASES.IDLE || phase === PHASES.ACCEPTING_COINS) {
        setPhase(PHASES.PRODUCT_SELECTED);
        addTransition(state, `Código ${newCode}`, state);
        
        if (balance >= product.price) {
          setMessage(`${product.name} - $${product.price}. Presiona OK`);
        } else {
          setMessage(`${product.name} - $${product.price}. Inserta $${product.price - balance}`);
        }
      }
    } else if (newCode.length >= 2) {
      setMessage('Código inválido');
      setInputCode('');
    }
  };

  const clearInput = () => {
    setInputCode('');
    setSelectedProduct(null);
    if (balance > 0) {
      setPhase(PHASES.ACCEPTING_COINS);
      setMessage(`Saldo: $${balance}. Digita código`);
    } else {
      setPhase(PHASES.IDLE);
      setMessage('Bienvenido! Inserta monedas');
    }
  };

  // Insertar moneda con validación de límite
  const insertCoin = (amount: number) => {
    // Validar que no se exceda el máximo
    if (balance + amount > MAX_BALANCE) {
      setMessage(`No se puede exceder $${MAX_BALANCE}. Saldo actual: $${balance}`);
      return;
    }

    coinSoundRef.current?.();
    const newBalance = balance + amount;
    const oldState = state;
    const newState = getStateFromBalance(newBalance);
    
    setBalance(newBalance);
    setState(newState);
    
    if (phase === PHASES.IDLE) {
      setPhase(PHASES.ACCEPTING_COINS);
      addTransition(oldState, `+$${amount}`, newState);
      setMessage('Digita código del producto');
    } else {
      addTransition(oldState, `+$${amount}`, newState);
      if (selectedProduct) {
        const remaining = selectedProduct.price - newBalance;
        if (remaining > 0) {
          setMessage(`${selectedProduct.name}. Faltan $${remaining}`);
        } else {
          setMessage(`${selectedProduct.name} - $${selectedProduct.price}. Presiona OK`);
        }
      } else {
        setMessage(`Saldo: $${newBalance}. Digita código`);
      }
    }
  };

  // Dispensar producto
  const dispenseProduct = () => {
    if (phase === PHASES.PRODUCT_SELECTED && selectedProduct && balance >= selectedProduct.price) {
      const oldState = state;
      setPhase(PHASES.DISPENSING);
      setDispensing(true);
      addTransition(oldState, 'OK/Dispensar', oldState);
      dispenseSoundRef.current?.();
      setMessage('Dispensando...');
      
      setTimeout(() => {
        const newBalance = balance - selectedProduct.price;
        const newState = getStateFromBalance(newBalance);
        
        setBalance(newBalance);
        setState(newState);
        setMessage(`Entregado! Saldo: $${newBalance}`);
        setDispensing(false);
        setInputCode('');
        
        if (newBalance > 0) {
          setPhase(PHASES.ACCEPTING_COINS);
          addTransition(oldState, `Producto entregado`, newState);
        } else {
          setPhase(PHASES.IDLE);
          addTransition(oldState, `Producto entregado`, newState);
          setSelectedProduct(null);
        }
      }, 2000);
    }
  };

  // Cancelar transacción
  const cancel = () => {
    addTransition(state, 'Cancel', 'Q0');
    setState('Q0');
    setPhase(PHASES.IDLE);
    setBalance(0);
    setSelectedProduct(null);
    setInputCode('');
    setMessage('Cancelado - Retira dinero');
    setTimeout(() => setMessage('Bienvenido! Inserta monedas'), 2000);
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-700 via-gray-800 to-gray-900 p-4 flex items-center justify-center">
      <div className="max-w-7xl w-full grid grid-cols-1 lg:grid-cols-12 gap-6">
        
        {/* Máquina expendedora con perspectiva 3D */}
        <div className="lg:col-span-8">
          <div 
            className="relative bg-gradient-to-b from-gray-400 via-gray-300 to-gray-400 rounded-3xl shadow-2xl border-8 border-gray-800"
            style={{
              transform: 'perspective(1200px) rotateY(-8deg)',
              transformStyle: 'preserve-3d',
              boxShadow: '40px 40px 80px rgba(0,0,0,0.5), inset 0 0 20px rgba(0,0,0,0.3)'
            }}
          >
            <div className="p-8" style={{ transform: 'translateZ(20px)' }}>
              
              {/* Panel superior con display */}
              <div className="bg-gradient-to-br from-cyan-400 to-cyan-600 rounded-xl p-4 mb-6 border-4 border-gray-600 shadow-lg">
                <div className="bg-cyan-300 rounded-lg p-3 border-2 border-cyan-700">
                  <div className="flex justify-between items-center mb-2">
                    <span className="text-lg font-bold text-gray-800">💳 Saldo</span>
                    <span className="text-2xl font-bold text-gray-900">{displayTime}</span>
                  </div>
                  <div className="bg-cyan-100 rounded p-3 border border-cyan-400">
                    <p className="text-cyan-900 font-bold text-xl text-center">${balance}</p>
                    <p className="text-cyan-700 text-xs text-center mt-1">Estado: {state} | Max: ${MAX_BALANCE}</p>
                  </div>
                </div>
              </div>

              {/* Vitrina de productos con fondo negro */}
              <div className="bg-black rounded-2xl p-6 mb-6 border-8 border-gray-700 shadow-inner">
                <div className="grid grid-cols-3 gap-6">
                  {products.map((product) => (
                    <div
                      key={product.id}
                      className="relative group"
                      style={{
                        transform: 'translateZ(10px)',
                        transition: 'all 0.3s'
                      }}
                    >
                      {/* Producto en espiral */}
                      <div className={`relative bg-gradient-to-br from-gray-800 to-black rounded-xl p-6 border-4 transition-all ${
                        selectedProduct?.id === product.id 
                          ? 'border-yellow-400 shadow-lg shadow-yellow-400/50 scale-105' 
                          : 'border-gray-600'
                      }`}>
                        
                        {/* Barra de luz superior */}
                        <div className="absolute top-0 left-0 right-0 h-1 bg-gradient-to-r from-transparent via-blue-400 to-transparent"></div>
                        
                        {/* Espiral metálica */}
                        <div className="absolute inset-0 opacity-20">
                          {[...Array(5)].map((_, i) => (
                            <div 
                              key={i}
                              className="absolute h-px bg-gray-400"
                              style={{
                                top: `${20 + i * 15}%`,
                                left: '10%',
                                right: '10%',
                                transform: `perspective(100px) rotateX(${45 + i * 10}deg)`
                              }}
                            ></div>
                          ))}
                        </div>

                        {/* Contenido del producto */}
                        <div className="relative z-10">
                          <div 
                            className="w-20 h-24 mx-auto mb-3 rounded-lg flex items-center justify-center text-4xl font-bold"
                            style={{ 
                              background: product.color,
                              boxShadow: `0 4px 15px ${product.color}80`
                            }}
                          >
                            🥨
                          </div>
                          <div className="text-white font-bold text-sm mb-1">{product.name}</div>
                          <div className="text-yellow-400 font-bold">${product.price}</div>
                          <div className="text-gray-400 text-xs mt-1 font-mono">{product.id}</div>
                        </div>

                        {/* Luces LED inferiores */}
                        <div className="absolute bottom-2 left-0 right-0 flex justify-center gap-1">
                          {[...Array(3)].map((_, i) => (
                            <div 
                              key={i}
                              className={`w-1 h-1 rounded-full ${
                                selectedProduct?.id === product.id ? 'bg-blue-400' : 'bg-gray-600'
                              }`}
                            ></div>
                          ))}
                        </div>
                      </div>

                      {/* Código de selección */}
                      <div className="mt-2 bg-gray-800 rounded px-3 py-1 border border-gray-600">
                        <span className="text-gray-300 text-xs font-mono">{product.id}</span>
                      </div>

                      
                    </div>
                  ))}
                </div>
              </div>

              {/* Panel de control lateral derecho */}
              <div className="grid grid-cols-3 gap-4">
                
                {/* Área de mensajes */}
                <div className="col-span-2 space-y-4">
                  {/* Display de mensaje */}
                  <div className="bg-gray-700 rounded-xl p-4 border-4 border-gray-800">
                    <div className="bg-blue-900 rounded-lg p-3 border-2 border-blue-600">
                      <p className="text-blue-300 text-sm font-mono">{message}</p>
                    </div>
                  </div>

                  {/* Ranura de monedas */}
                  <div className="bg-gray-800 rounded-xl p-4 border-4 border-gray-900">
                    <div className="text-yellow-400 text-xs font-bold mb-2 text-center">💰 MONEDAS</div>
                    <div className="grid grid-cols-4 gap-2">
                      {[100, 200, 500, 1000].map(coin => {
                        const wouldExceed = balance + coin > MAX_BALANCE;
                        return (
                          <button
                            key={coin}
                            onClick={() => insertCoin(coin)}
                            disabled={dispensing || wouldExceed}
                            className={`font-bold py-3 px-2 rounded-lg transform transition hover:scale-110 active:scale-95 text-xs ${
                              wouldExceed 
                                ? 'bg-gray-600 text-gray-400 cursor-not-allowed opacity-50' 
                                : 'bg-gradient-to-b from-yellow-400 to-yellow-600 hover:from-yellow-300 hover:to-yellow-500 text-black'
                            }`}
                          >
                            ${coin}
                          </button>
                        );
                      })}
                    </div>
                  </div>
                </div>

                {/* Panel de botones numérico */}
                <div className="bg-gray-800 rounded-xl p-4 border-4 border-gray-900">
                  {/* Display del código ingresado */}
                  <div className="bg-gray-900 rounded-lg p-2 mb-3 border-2 border-gray-700 min-h-[40px] flex items-center justify-center">
                    <span className="text-green-400 font-mono text-xl">{inputCode || '_'}</span>
                  </div>
                  
                  <div className="grid grid-cols-3 gap-2 mb-3">
                    {[1, 2, 3, 4, 5, 6, 7, 8, 9].map(num => (
                      <button
                        key={num}
                        onClick={() => handleNumberPress(num.toString())}
                        disabled={dispensing}
                        className="bg-gray-700 hover:bg-gray-600 text-white font-bold py-2 rounded border-2 border-gray-600 text-sm active:bg-gray-500 disabled:opacity-50"
                      >
                        {num}
                      </button>
                    ))}
                    <button 
                      onClick={clearInput}
                      disabled={dispensing}
                      className="bg-gray-700 hover:bg-gray-600 text-white font-bold py-2 rounded border-2 border-gray-600 text-sm active:bg-gray-500 disabled:opacity-50">
                      C
                    </button>
                    <button
                      onClick={() => handleNumberPress('0')}
                      disabled={dispensing}
                      className="bg-gray-700 hover:bg-gray-600 text-white font-bold py-2 rounded border-2 border-gray-600 text-sm active:bg-gray-500 disabled:opacity-50">
                      0
                    </button>
                    <button className="bg-gray-700 text-gray-500 font-bold py-2 rounded border-2 border-gray-600 text-sm cursor-not-allowed">
                      #
                    </button>
                  </div>
                  
                  {/* Botones de acción */}
                  <button
                    onClick={dispenseProduct}
                    disabled={!selectedProduct || balance < (selectedProduct?.price || 0) || dispensing}
                    className="w-full bg-green-600 hover:bg-green-500 text-white font-bold py-3 rounded-lg mb-2 disabled:opacity-50 disabled:cursor-not-allowed text-xs"
                  >
                    OK
                  </button>
                  <button
                    onClick={cancel}
                    disabled={dispensing}
                    className="w-full bg-red-600 hover:bg-red-500 text-white font-bold py-3 rounded-lg disabled:opacity-50 disabled:cursor-not-allowed text-xs"
                  >
                    CANCEL
                  </button>
                </div>
              </div>

                            {/* Bandeja de entrega */}
                            <div className="mt-6 bg-gray-800 rounded-b-2xl p-4 border-4 border-gray-900">
                <div className="bg-black h-16 rounded-lg border-2 border-gray-700 flex items-center justify-center relative">
                  {dispensing ? (
                    <div className="text-6xl animate-bounce">📦</div>
                  ) : (
                    <span className="text-gray-600 text-xs">🎁 RETIRA TU PRODUCTO AQUÍ</span>
                  )}
                </div>
              </div>

              {/* Rejilla de ventilación inferior */}
              <div className="mt-4 grid grid-cols-12 gap-1 px-4">
                {[...Array(48)].map((_, i) => (
                  <div key={i} className="h-1 bg-gray-600 rounded-full"></div>
                ))}
              </div>
            </div>
          </div>
        </div>

        {/* Panel de información del autómata */}
        <div className="lg:col-span-4">
          <div className="bg-gray-800 rounded-xl p-6 border-4 border-gray-700 shadow-xl h-full">
            <h2 className="text-2xl font-bold text-white mb-4">📊 Autómata Finito</h2>
            
            {/* Estado actual */}
            <div className="bg-gradient-to-r from-blue-600 to-blue-800 rounded-lg p-4 mb-4 border-2 border-blue-400">
              <p className="text-xs text-blue-200 mb-1">Estado Actual:</p>
              <p className="text-xl font-bold text-white">{state}</p>
              <p className="text-xs text-blue-300 mt-1">Fase: {phase}</p>
            </div>

            {/* Información del autómata */}
            <div className="bg-gray-900 rounded-lg p-3 border-2 border-gray-700 mb-4">
              <h3 className="text-sm font-bold text-white mb-2">Estados (Q):</h3>
              <p className="text-xs text-gray-300 mb-2">Q0, Q1, Q2, ..., Q30</p>
              <p className="text-xs text-gray-400">Cada estado representa $100</p>
              <p className="text-xs text-gray-400">Q0 = $0, Q30 = $3000</p>
            </div>

            {/* Log de transiciones */}
            <div className="bg-gray-900 rounded-lg p-3 border-2 border-gray-700 mb-4">
              <h3 className="text-sm font-bold text-white mb-2">Transiciones:</h3>
              <div className="space-y-1 max-h-64 overflow-y-auto">
                {transitionLog.slice().reverse().map((t) => (
                  <div key={t.time} className="bg-gray-800 rounded p-2 text-xs border border-gray-700">
                    <p className="text-blue-400">{t.from}</p>
                    <p className="text-gray-500">→ {t.input}</p>
                    <p className="text-green-400">→ {t.to}</p>
                  </div>
                ))}
              </div>
            </div>

            {/* Productos disponibles */}
            <div className="bg-gray-900 rounded-lg p-3 border-2 border-gray-700">
              <h3 className="text-sm font-bold text-white mb-2">Productos:</h3>
              {products.map(p => (
                <div key={p.id} className="text-xs text-gray-300 mb-1">
                  • {p.id}: {p.name} - ${p.price}
                </div>
              ))}
            </div>

            {/* Alfabeto */}
            <div className="bg-gray-900 rounded-lg p-3 border-2 border-gray-700 mt-4">
              <h3 className="text-sm font-bold text-white mb-2">Σ (Alfabeto):</h3>
              <p className="text-xs text-gray-300">+100, +200, +500, +1000</p>
              <p className="text-xs text-gray-300">11, 12, 13 (códigos)</p>
              <p className="text-xs text-gray-300">OK, Cancel</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default VendingMachine;

